import React from 'react'

const StatusList = ({listID,listTitle, Cards}) =>
{
  
    return (
        <div>
            <div>{listTitle}</div>
        <div>
       {cards.map(card => (<OperationCard key={card.id} title={card.title}/> ))} 
       <OperationAddCardButton listID={listID}/>
       </div>
        </div>
    )
}

export default StatusList;
